import React, { useEffect, useState } from "react";

export default function DataFetch() {
  const [todos, setTodos] = useState();
  useEffect(() => {
    fetch("https://jsonplaceholder.typicode.com/todos")
      .then((res) => {
        return res.json();
      })
      .then((data) => {
        setTodos(data);
        console.log(todos);
      });
  }, []);
  return <div>
    {todos && todos.map(()=>{})}
  </div>;
}
